import './App.css';
import Header from './Header';
import Home from './Home';

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <div className="App">
        <Route path="/"></Route>

        </div>
      </Switch>
    </Router>

  );
}

export default App;
